import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="navbar-brand mr-auto">
        <h1>Peleas de Hockey</h1>
      </div>
    </nav>
  );
};

export default Navbar;
